import React, { Component } from 'react';

class Skills extends Component {

  render() {
    return (
        <div id='skills'>    
            <div id='title'>My Skills</div>
            <div className='container d-flex justify-content-around'>
                <div className='col-md-5'>
                    <div className="d-flex justify-content-between"><span>Photoshop</span><span>65%</span></div>
                    <div className="progress">
                        <div className="progress-bar" role="progressbar" style={{width: "65%"}} aria-valuenow="75" aria-valuemin="0" aria-valuemax="90"></div>
                    </div>
                </div>
                <div className='col-md-5'>
                    <div className="d-flex justify-content-between"><span>HTML</span><span>65%</span></div>
                    <div className="progress">
                        <div className="progress-bar" role="progressbar" style={{width: "65%"}} aria-valuenow="75" aria-valuemin="0" aria-valuemax="90"></div>
                    </div>
                </div>
            </div>
        </div>
    );
  }
}

export default Skills;
